package com.myou.autoword.web;

import com.alibaba.fastjson.JSON;
import com.alibaba.fastjson.serializer.SerializerFeature;
import com.myou.autoword.handler.elements.DateSlicer;
import com.myou.autoword.handler.elements.ImageData;
import com.myou.autoword.handler.results.InvokeResult;
import com.myou.autoword.handler.services.TemplateResultSync;
import com.myou.autoword.handler.services.impl.TemplateGenerateSync;
import com.myou.autoword.web.ResultAutoProxys.OssProxy;
import com.myou.autoword.web.TemplateModels.AdversaryIdentificationTemplate;
import com.myou.autoword.web.TemplateModels.JudicialConfirmationTemplate;
import org.junit.jupiter.api.Test;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.util.Assert;

import java.util.Date;
import java.util.List;

@SpringBootTest
class AutoWordWebApplicationTests {

    @Test
    void contextLoads() throws InterruptedException {
        OssProxy ossProxy = new OssProxy();

        // 模板一
        JudicialConfirmationTemplate judicialConfirmationTemplate = new JudicialConfirmationTemplate();
        judicialConfirmationTemplate.setPlaintiff("张三");
        judicialConfirmationTemplate.setDefendant("李四");
        judicialConfirmationTemplate.setSubject("金钱纠纷");
        judicialConfirmationTemplate.setMediateYear("2020");
        judicialConfirmationTemplate.setMediateMonth("06");
        judicialConfirmationTemplate.setMediateDay("01");
        judicialConfirmationTemplate.setOrganization("瓦罗兰");
        judicialConfirmationTemplate.setMediator("小法");
        judicialConfirmationTemplate.setDateSlicer(new DateSlicer(new Date()));

        // 模板二
        AdversaryIdentificationTemplate template = new AdversaryIdentificationTemplate();
        template.setName("阿喜");
        template.setIdCard("413026188976767555");
        template.setObverseImg(new ImageData(
                200,
                200,
                "zheng",
                "",
                ""));
        template.setReverseImg(new ImageData(
                200,
                200,
                "fan",
                "",
                ""));

        // 执行策略
        TemplateGenerateSync.invokeBindAndReturnResultSync(new TemplateResultSync() {
            @Override
            public void invokeSyncFailed(boolean isSuccess, String failMsg) {
                System.out.println(String.format("result:%s,Msg:%s", isSuccess, failMsg));
            }

            @Override
            public void invokeSync(boolean isSuccess, List<InvokeResult> msg) {
                System.out.println(String.format("result:%s,Msg:%s", isSuccess, JSON.toJSONString(msg, SerializerFeature.WriteDateUseDateFormat)));
            }
        }, ossProxy, judicialConfirmationTemplate, template);
        Thread.sleep(40000);
        Assert.isTrue(true, "end");
    }

}
